import React, {useState} from 'react';

//Bootstrap
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'

//Component
import Selector from './Selector.js'

function CustomPlaylistForm () {


    return (
        <div>
            <Form id="customForm">
                <Form.Group class="formGroup" controlId="playlistName">
                    <Form.Label class="formLabel">Playlist Name</Form.Label>
                    <Form.Control type="text" placeholder="Generated Playlist" />
                </Form.Group>

                <Form.Group class="formGroup" controlId="playlistName">
                    <h4>Select Up To 5 Of The Following</h4>
                    <Selector />
                </Form.Group>

                <Button variant="primary" type="submit">
                    Submit
                </Button>
            </Form>
        </div>
    );
}

export default CustomPlaylistForm;
